.cart-toggle__header-container {
  position: relative;
  display: flex;
  padding: 16px 24px 16px 24px;
  justify-content: space-between;
  align-items: center;
  border: 1px solid #e6e6e6;
}

.cart-toggle__items-container {
  display: flex;
  padding-top: 100px;
  padding-bottom: 100px;
  justify-content: center;
  align-items: center;
}

.cart-toggle__header {
  font-size: 1.2rem;
  line-height: 24px;
}

.close-icon {
  width: 15px;
  height: 15px;
  cursor: pointer;
}

.menu-toggle__mobile-nav {
  display: none;
}

@media screen and (max-width: 1100px) {
  .main {
    flex-direction: column;
    height: auto;
  }
  .left-side {
    width: 100%;
  }
  .ls_panel {
    height: 50vh;
  }
  .nav {
    position: fixed;
    left: 0%;
    top: 0%;
    right: 0%;
    bottom: auto;
    z-index: 99;
    display: block;
    background-color: hsla(0, 0%, 86.7%, 0);
  }
  .right-side {
    width: 100%;
  }
  .right-side__right-panel-wrapper {
    position: relative;
    flex-direction: column;
  }
  .rs-panel {
    height: 50vh;
    flex: 0 auto;
    background-position: 50% 50%;
    background-size: cover;
  }

  .rs-panel1 {
    background-image: linear-gradient(
        180deg,
        rgba(0, 0, 0, 0.4),
        rgba(0, 0, 0, 0.4)
      ),
      url("../assets/im1.png");
  }
  .rs-panel2 {
    background-image: linear-gradient(
        180deg,
        rgba(0, 0, 0, 0.4),
        rgba(0, 0, 0, 0.4)
      ),
      url("../assets/im2.png");
  }
  .rs-panel3 {
    background-image: linear-gradient(
        180deg,
        rgba(0, 0, 0, 0.4),
        rgba(0, 0, 0, 0.4)
      ),
      url("../assets/im3.png");
  }
  .rs-panel4 {
    background-image: linear-gradient(
        180deg,
        rgba(0, 0, 0, 0.4),
        rgba(0, 0, 0, 0.4)
      ),
      url("../assets/im4.png");
  }
  .rs-panel5 {
    background-image: linear-gradient(
        180deg,
        rgba(0, 0, 0, 0.4),
        rgba(0, 0, 0, 0.4)
      ),
      url("../assets/im5.png");
  }
  .swiper-buttons-wrapper {
    display: none;
  }
  .nav__list {
    visibility: hidden;
  }

  .left-panel1__logo-wrapper {
    margin-top: 31px;
    z-index: 30;
  }
  .menu-toggle {
    left: 0;
    z-index: 10;
    height: 100vh;
    width: 100%;
  }
  .menu-toggle__mobile-nav {
    display: flex;
    flex-direction: column;
  }
  .mobile-menu-link {
    display: block;
  }
  .menu-link::after {
    display: block;
    margin-bottom: 10px;
    content: "";
    width: 250px;
    height: 1px;
    background-color: #e5e5e5;
  }
}

@media screen and (max-width: 411px) {
  .cart-toggle {
    width: 340px;
  }
  .menu-toggle__container {
    padding-top: 50px;
  }
}

@media screen and (max-width: 320px) {
  .cart-toggle {
    width: 245px;
  }
  .menu-toggle__container {
    padding-top: 50px;
  }
  .top-content__text {
    margin-bottom: 10px;
  }
}

@media screen and (max-width: 281px) {
  .cart-toggle {
    max-width: 200px;
  }
}
